import { Layout, Menu } from 'antd';
import React  from 'react';


const backgroundImage = 'images/woman.jpg';
const SidebarHeader = '/LogoW.png'
const menuItems = [
  { name: 'Home', to: '/', icon: 'icons/home.svg' },
  { name: 'Porfile', to: '/porfile', icon: 'icons/porfile.svg' },
  { name: 'Ubication', to: '/ubication', icon: 'icons/ubication.svg' },
  { name: 'Reports', to: '/reports', icon: 'icons/reports.svg' },
  { name: 'Chat', to: '/chat', icon: 'icons/chat.svg' }
];

const fonts = {
  header: 'ZCOOL KuaiLe',
  menu: 'Poppins'
}

const { Header, Sider, Content } = Layout;

class Profile extends React.Component {
  state = {
    collapsed: false,
  };

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };

  render() {
    return (
      <Layout>
        <Sider trigger={null} collapsible collapsed={this.state.collapsed}>
          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']}>
            <Menu.Item key="1" icon={icons/chat.svg}>
              nav 1
            </Menu.Item>
            <Menu.Item key="2" icon={'icons/ubication.svg'}>
              nav 2
            </Menu.Item>
            <Menu.Item key="3" icon={'icons/porfile.svg'}>
              nav 3
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }}>
            {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
              className: 'trigger',
              onClick: this.toggle,
            })}
          </Header>
          <Content
            className="site-layout-background"
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
            }}
          >
            Content
          </Content>
        </Layout>
      </Layout>
    );
  }
}

export default Profile
